
DROP TABLE IF EXISTS "ChampionshipMembers";
DROP SEQUENCE IF EXISTS "Gamers_id_seq" cascade ;
CREATE SEQUENCE "Gamers_id_seq" START WITH 1 INCREMENT by 1 NO MINVALUE NO MAXVALUE CACHE 1;
DROP TYPE IF EXISTS "enum_Gamers_status" cascade;
CREATE TYPE "enum_Gamers_status" AS ENUM (
    'New',
    'Accepted',
    'Declined'
    );

CREATE TABLE "public"."ChampionshipMembers" (
                                                "id" integer DEFAULT nextval('"Gamers_id_seq"') NOT NULL,
                                                "userId" integer NOT NULL,
                                                "championshipId" integer,
                                                "status" "enum_Gamers_status" DEFAULT 'New' NOT NULL,
                                                "createdAt" timestamptz NOT NULL,
                                                "updatedAt" timestamptz NOT NULL,
                                                CONSTRAINT "ChampionshipMembers_userId_championshipId" UNIQUE ("userId", "championshipId")
) WITH (oids = false);


DROP TABLE IF EXISTS "ChampionshipOptions";
DROP SEQUENCE IF EXISTS "ChampionshipsOption_id_seq";
CREATE SEQUENCE "ChampionshipsOption_id_seq"
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    MAXVALUE 2147483647
    CACHE 1;
CREATE TABLE "public"."ChampionshipOptions" (
                                                "id" integer DEFAULT nextval('"ChampionshipsOption_id_seq"') NOT NULL,
                                                "championshipId" integer NOT NULL,
                                                "key" character varying(150) NOT NULL,
                                                "value" character varying(150) NOT NULL,
                                                "createdAt" timestamptz NOT NULL,
                                                "updatedAt" timestamptz NOT NULL,
                                                "ordering" integer DEFAULT '0' NOT NULL
) WITH (oids = false);


DROP TABLE IF EXISTS "ChampionshipShedule";
DROP SEQUENCE IF EXISTS "ChampionshipShedule_id_seq";
CREATE SEQUENCE "ChampionshipShedule_id_seq"
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    MAXVALUE 2147483647
    CACHE 1;
CREATE TABLE "public"."ChampionshipShedule" (
                                                "id" integer DEFAULT nextval('"ChampionshipShedule_id_seq"') NOT NULL,
                                                "championshipId" integer NOT NULL,
                                                "datetime" timestamptz NOT NULL,
                                                "value" character varying(150) NOT NULL,
                                                "createdAt" timestamptz NOT NULL,
                                                "updatedAt" timestamptz NOT NULL
) WITH (oids = false);


DROP TABLE IF EXISTS "Championships";
DROP SEQUENCE IF EXISTS "Championships_id_seq";
CREATE SEQUENCE "Championships_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;
CREATE TABLE "public"."Championships" (
                                          "id" integer DEFAULT nextval('"Championships_id_seq"') NOT NULL,
                                          "userId" integer NOT NULL,
                                          "clubId" integer NOT NULL,
                                          "name" character varying(100) NOT NULL,
                                          "date" timestamptz NOT NULL,
                                          "memberPrice" real,
                                          "guestPrice" real NOT NULL,
                                          "createdAt" timestamptz NOT NULL,
                                          "updatedAt" timestamptz NOT NULL,
                                          "description" text,
                                          CONSTRAINT "Championships_pkey" PRIMARY KEY ("id")
) WITH (oids = false);


DROP TABLE IF EXISTS "ChatMessageRead";
DROP SEQUENCE IF EXISTS "ChatMessageRead_id_seq";
CREATE SEQUENCE "ChatMessageRead_id_seq" start with 1 INCREMENT by 1 MINVALUE 1 NO MAXVALUE  CACHE 1 ;

CREATE TABLE "public"."ChatMessageRead" (
                                            "id" integer DEFAULT nextval('"ChatMessageRead_id_seq"') NOT NULL,
                                            "createdAt" timestamptz NOT NULL,
                                            "updatedAt" timestamptz NOT NULL,
                                            "userId" integer NOT NULL,
                                            "chatMessageId" integer NOT NULL,
                                            CONSTRAINT "ChatMessageRead_pkey" PRIMARY KEY ("id"),
                                            CONSTRAINT "ChatMessageRead_userId_chatMessageId_key" UNIQUE ("userId", "chatMessageId")
) WITH (oids = false);

CREATE INDEX "chat_message_read_chat_message_id" ON "public"."ChatMessageRead" USING btree ("chatMessageId");

CREATE INDEX "chat_message_read_user_id" ON "public"."ChatMessageRead" USING btree ("userId");


DROP TABLE IF EXISTS "ChatMessages";
DROP SEQUENCE IF EXISTS "ChatMessages_id_seq";
CREATE SEQUENCE "ChatMessages_id_seq" start with 1 INCREMENT by 1  MINVALUE 1  NO MAXVALUE  CACHE 1 ;

CREATE TABLE "public"."ChatMessages" (
                                         "id" integer DEFAULT nextval('"ChatMessages_id_seq"') NOT NULL,
                                         "createdAt" timestamptz NOT NULL,
                                         "updatedAt" timestamptz NOT NULL,
                                         "userId" integer NOT NULL,
                                         "chatId" integer NOT NULL,
                                         "text" text,
                                         "files" json,
                                         CONSTRAINT "ChatMessages_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

CREATE INDEX "chat_messages_chat_id" ON "public"."ChatMessages" USING btree ("chatId");

CREATE INDEX "chat_messages_user_id" ON "public"."ChatMessages" USING btree ("userId");


DROP TABLE IF EXISTS "ChatUsers";
DROP SEQUENCE IF EXISTS "ChatUsers_id_seq";
CREATE SEQUENCE "ChatUsers_id_seq" start with 1 INCREMENT by 1 MINVALUE 1  No  MAXVALUE  CACHE 1 ;

CREATE TABLE "public"."ChatUsers" (
                                      "id" integer DEFAULT nextval('"ChatUsers_id_seq"') NOT NULL,
                                      "createdAt" timestamptz NOT NULL,
